utline: 0px; clear: none;\">\n<h1 style=\"margin: 0px 0px 21px; padding: 0px; border: 0px; font-size: 16px; font: inherit; vertical-align: baseline; outline: 0px;\">Dass Frankreich an der geografischen Taille Malis, die<strong> den S&uuml;den und die Hauptstadt Bamako vom mittlerweile islamistisch beherrschten Norden Malis trennt, eine Linie im Sand gezogen und am Freitag milit&auml;risch rasch reagiert hat, hat die innenpolitische Stellung von Pr&auml;sident Hollande zieml</strong>ich ver&auml;ndert. Der bis anhin als z&ouml;gerlich und abtastend geltende Staatschef scheint eine Zuspitzung der Lage im westafrikanischen Land erwartet und sich gut vorbereitet zu haben. Von wenigen Ausnahmen abgesehen, gibt es kaum kritische Stimmen in Frankreich. Im R&uuml;ckblick f&auml;llt auf, dass Hollande in seinen Erkl&auml;rungen immer wieder vor islamistischen Extremisten im Sahel gewarnt hat.</h1>\n</div>\n</div>', null, null, null, '', '', '-1', '2013-01-13 23:25:27', '2013-01-13 23:27:23', null), ('2747', null, 'insert', '3489', '', '2745', '-1', '-1', '-1', '-1', null, '', '50', '50', '-1', '-1', '-1', 'published', '', 'text', 'rtf', null, '<p>Wo leben wir <span style=\"text-decoration: line-through;\">heute</span>? Im <strong>Armenviertel</strong>? Ja!</p>', null, null, null, '', null, '-1', '2013-01-14 07:50:56', '2013-01-14 07:50:56', null), ('2748', null, 'insert', '3489', '', '2745', '-1', '-1', '-1', '-1', null, '', '50', '50', '-1', '-1', '-1', 'published', '', 'text', 'plain', null, 'Computerspiel > Film (Tomb Rider, Nachahmen von Figur); Film > Computerspiel (filmische Passagen); und wie verhält es sich mit Computerspiel > Literatur? Hier Glavinic als hypothetisches Beispiel angeben: Das Leben der Wünsche (Wahlmöglichkeit; ähnlich Märchen (Computerspiel und Märchen: Jürgen Fritz); Das bin doch ich (Avatar) ', null, null, null, '', null, '-1', '2013-01-14 07:52:03', '2013-01-14 07:52:03', null), ('2749', null, 'insert', '3489', '', '2697', '-1', '-1', '-1', '-1', 