DROP TABLE IF EXISTS `TextObjectAttribute`;
CREATE TABLE `TextObjectAttribute` (
  `textobjectattributeId` bigint(21) NOT NULL AUTO_INCREMENT,
  `textobjectattributeTextObjectRef` bigint(21) DEFAULT '-1',
  `textobjectattributeUserRef` bigint(21) DEFAULT '-1',
  `textobjectattributeName` varchar(255) DEFAULT NULL COMMENT 'Owner/Collaborater/Freerider [read+write+rulesetter/read+write/read]',
  `textobjectattributeCreate` datetime DEFAULT NULL COMMENT 'Stores Preferences/UserPrefs (Hide) etc. ',
  PRIMARY KEY (`textobjectattributeId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `TextObjectVersion`
-- ----------------------------
DROP TABLE IF EXISTS `TextObjectVersion`;
CREATE TABLE `TextObjectVersion` (
